grpc:
  server:
    in-process-name: testservice
    port: -1
  client:
    testservice:
      address: in-process:testservice
qp:
  mill:
    backend:
      security:
        enabled: false
      calcite:
        connection:
          quoting: BACK_TICK
          caseSensitive: true
          unquotedCasing: UNCHANGED
          model: ./etc/config/test/model.yaml
